import React from "react";

const StarRating = ({ rate }) => {
  const startab = [];
  for (let i = 1; i <= rate; i++) {
    i <= rate
      ? startab.push(<span style={{ color: "yellow" }}>★</span>)
      : startab.push(<span style={{ color: "black" }}>★</span>);
  }

  return <div>{startab}</div>;
};

export default StarRating;
